import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const name = '山田'
  ReactDOM.render(
    <div>
      <p>名前は、{'$' + name + '$'}</p>
      <p>現在の日時は、{new Date().toLocateString()}です。</p>
      <p>2の3乗は、{2 **3 }</p>
    </div>,
    document.getElementById('root')
  );  

